import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { 
  FaRocket, FaUsers, FaChartLine, FaCogs
} from 'react-icons/fa';
import { useTheme } from '../styles/ThemeContext';

const SkillsSection = styled.section`
  padding: ${props => props.theme.spacing.section} 0;
  background: linear-gradient(135deg, rgba(255, 255, 255, 0.02) 0%, rgba(255, 255, 255, 0.01) 100%);
  position: relative;
  overflow: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background: radial-gradient(circle at 60% 40%, rgba(102, 126, 234, 0.06) 0%, transparent 50%),
                radial-gradient(circle at 40% 60%, rgba(118, 75, 162, 0.06) 0%, transparent 50%);
    pointer-events: none;
  }
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 ${props => props.theme.spacing.xl};
  position: relative;
  z-index: 2;

  @media (max-width: ${props => props.theme.breakpoints.md}) {
    padding: 0 ${props => props.theme.spacing.lg};
  }
`;

const SectionHeader = styled(motion.div)`
  text-align: center;
  margin-bottom: ${props => props.theme.spacing.xxxl};
`;

const SectionTitle = styled(motion.h2)`
  font-size: clamp(2.5rem, 5vw, 3.5rem);
  font-weight: ${props => props.theme.fonts.weights.extrabold};
  color: ${props => props.isDarkMode ? '#ffffff' : '#0f172a'};
  margin-bottom: ${props => props.theme.spacing.lg};
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
  text-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
`;

const SectionSubtitle = styled(motion.p)`
  font-size: ${props => props.theme.fonts.sizes.lg};
  color: ${props => props.isDarkMode ? '#cbd5e1' : '#475569'};
  max-width: 700px;
  margin: 0 auto;
  line-height: 1.8;
  opacity: 0.9;
`;

const SkillsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: ${props => props.theme.spacing.xl};
  margin-bottom: ${props => props.theme.spacing.xxxl};
`;

const SkillCategory = styled(motion.div)`
  background: rgba(255, 255, 255, 0.1);
  backdrop-filter: blur(20px);
  border: 1px solid rgba(255, 255, 255, 0.2);
  border-radius: ${props => props.theme.borderRadius.xl};
  padding: ${props => props.theme.spacing.xl};
  box-shadow: 0 8px 32px rgba(0, 0, 0, 0.1);
  transition: all ${props => props.theme.transitions.normal};

  &:hover {
    transform: translateY(-8px);
    background: rgba(255, 255, 255, 0.15);
    box-shadow: 0 20px 40px rgba(0, 0, 0, 0.15);
  }
`;

const CategoryHeader = styled.div`
  display: flex;
  align-items: center;
  gap: ${props => props.theme.spacing.md};
  margin-bottom: ${props => props.theme.spacing.lg};
`;

const CategoryIcon = styled.div`
  width: 50px;
  height: 50px;
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
  border-radius: ${props => props.theme.borderRadius.lg};
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-size: ${props => props.theme.fonts.sizes.lg};
  box-shadow: 0 4px 12px rgba(102, 126, 234, 0.3);
`;

const CategoryTitle = styled.h3`
  font-size: ${props => props.theme.fonts.sizes.xl};
  font-weight: ${props => props.theme.fonts.weights.bold};
  color: ${props => props.isDarkMode ? '#ffffff' : '#0f172a'};
`;

const SkillsList = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(120px, 1fr));
  gap: ${props => props.theme.spacing.md};
`;

const SkillItem = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  text-align: center;
  padding: ${props => props.theme.spacing.md};
  background: rgba(255, 255, 255, 0.05);
  border-radius: ${props => props.theme.borderRadius.lg};
  border: 1px solid rgba(255, 255, 255, 0.1);
  transition: all ${props => props.theme.transitions.normal};

  &:hover {
    background: rgba(255, 255, 255, 0.1);
    transform: translateY(-4px);
    box-shadow: 0 8px 24px rgba(0, 0, 0, 0.1);
  }
`;

const SkillIcon = styled.div`
  width: 40px;
  height: 40px;
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
  border-radius: ${props => props.theme.borderRadius.md};
  display: flex;
  align-items: center;
  justify-content: center;
  color: white;
  font-size: ${props => props.theme.fonts.sizes.md};
  margin-bottom: ${props => props.theme.spacing.sm};
  box-shadow: 0 2px 8px rgba(102, 126, 234, 0.3);
`;

const SkillName = styled.span`
  font-size: ${props => props.theme.fonts.sizes.sm};
  font-weight: ${props => props.theme.fonts.weights.medium};
  color: ${props => props.isDarkMode ? '#cbd5e1' : '#475569'};
`;

const SkillLevel = styled.div`
  width: 100%;
  height: 4px;
  background: rgba(255, 255, 255, 0.1);
  border-radius: ${props => props.theme.borderRadius.full};
  margin-top: ${props => props.theme.spacing.sm};
  overflow: hidden;

  &::after {
    content: '';
    display: block;
    height: 100%;
    background: linear-gradient(90deg, #667eea 0%, #764ba2 100%);
    border-radius: ${props => props.theme.borderRadius.full};
    width: ${props => props.level}%;
    transition: width 1s ease-in-out;
  }
`;

const Skills = () => {
  const { isDarkMode } = useTheme();
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const skillCategories = [
    {
      id: 1,
      title: 'Product Management',
      icon: FaRocket,
      skills: [
        { name: 'Product Strategy', level: 95, icon: 'üéØ' },
        { name: 'User Research', level: 90, icon: 'üîç' },
        { name: 'Data Analytics', level: 85, icon: 'üìä' },
        { name: 'A/B Testing', level: 88, icon: 'üß™' },
        { name: 'Roadmapping', level: 92, icon: 'üó∫Ô∏è' },
        { name: 'Stakeholder Management', level: 87, icon: 'ü§ù' }
      ]
    },
    {
      id: 2,
      title: 'Technical Skills',
      icon: FaCogs,
      skills: [
        { name: 'API Integration', level: 85, icon: 'üîå' },
        { name: 'SQL', level: 80, icon: 'üóÑÔ∏è' },
        { name: 'Python', level: 75, icon: 'üêç' },
        { name: 'JavaScript', level: 70, icon: '‚ö°' },
        { name: 'Git', level: 85, icon: 'üìù' },
        { name: 'AWS', level: 75, icon: '‚òÅÔ∏è' }
      ]
    },
    {
      id: 3,
      title: 'Leadership',
      icon: FaUsers,
      skills: [
        { name: 'Team Management', level: 90, icon: 'üë•' },
        { name: 'Mentoring', level: 88, icon: 'üéì' },
        { name: 'Cross-functional Collaboration', level: 85, icon: 'ü§ù' },
        { name: 'Project Management', level: 87, icon: 'üìã' },
        { name: 'Strategic Planning', level: 92, icon: 'üéØ' },
        { name: 'Change Management', level: 83, icon: 'üîÑ' }
      ]
    },
    {
      id: 4,
      title: 'Business & Analytics',
      icon: FaChartLine,
      skills: [
        { name: 'Business Intelligence', level: 88, icon: 'üìà' },
        { name: 'Financial Modeling', level: 82, icon: 'üí∞' },
        { name: 'Market Analysis', level: 85, icon: 'üìä' },
        { name: 'Competitive Analysis', level: 87, icon: 'üîç' },
        { name: 'ROI Optimization', level: 90, icon: 'üìà' },
        { name: 'Growth Strategy', level: 88, icon: 'üöÄ' }
      ]
    }
  ];

  return (
    <SkillsSection id="skills">
      <Container>
        <SectionHeader
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.6 }}
        >
          <SectionTitle isDarkMode={isDarkMode}>Skills & Expertise</SectionTitle>
          <SectionSubtitle isDarkMode={isDarkMode}>
            A comprehensive skill set developed over a decade of product management experience, 
            combining technical expertise with strategic business acumen.
          </SectionSubtitle>
        </SectionHeader>

        <SkillsGrid ref={ref}>
          {skillCategories.map((category, index) => (
            <SkillCategory
              key={category.id}
              initial={{ opacity: 0, y: 30 }}
              animate={inView ? { opacity: 1, y: 0 } : {}}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              whileHover={{ scale: 1.02 }}
            >
              <CategoryHeader>
                <CategoryIcon>
                  <category.icon />
                </CategoryIcon>
                <CategoryTitle isDarkMode={isDarkMode}>{category.title}</CategoryTitle>
              </CategoryHeader>

              <SkillsList>
                {category.skills.map((skill, skillIndex) => (
                  <SkillItem
                    key={skillIndex}
                    initial={{ opacity: 0, scale: 0.8 }}
                    animate={inView ? { opacity: 1, scale: 1 } : {}}
                    transition={{ duration: 0.4, delay: (index * 0.1) + (skillIndex * 0.05) }}
                  >
                    <SkillIcon>{skill.icon}</SkillIcon>
                    <SkillName isDarkMode={isDarkMode}>{skill.name}</SkillName>
                    <SkillLevel level={skill.level} />
                  </SkillItem>
                ))}
              </SkillsList>
            </SkillCategory>
          ))}
        </SkillsGrid>
      </Container>
    </SkillsSection>
  );
};

export default Skills;
